// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { cellRenderFunction } from 'js/CellService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/CellService', () => import('js/CellService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "cellRenderFunction",
            "deps": "js/CellService"
        }
    },
    "data": {},
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "render": "render"
    },
    "_viewModelId": "Cell",
    "_uniqueViewModelId": "Cell",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, cellRenderFunction, undefined, ctxImportObj );

export default Component;
